-- ----------------------------
-- Table structure for comment
-- ----------------------------
DROP TABLE IF EXISTS `comment`;
CREATE TABLE `comment`  (
  `Id` int(4) NOT NULL AUTO_INCREMENT COMMENT '评论Id',
  `userId` int(4) NULL DEFAULT NULL COMMENT '用户Id',
  `userName` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户名',
  `parkingId` int(4) NULL DEFAULT NULL COMMENT '停车场Id',
  `star` tinyint(10) NULL DEFAULT NULL COMMENT '星星的数量;',
  `comType` tinyint(4) NULL DEFAULT NULL COMMENT '评论类型:0:差评,1:中评,2:好评',
  `status` tinyint(4) NULL DEFAULT NULL COMMENT '状态:0:禁用,1:启用',
  `content` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '内容',
  `createTime` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `updateTime` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户对停车场信息评论表' ROW_FORMAT = Dynamic;

