-- ----------------------------
-- Table structure for order
-- ----------------------------
DROP TABLE IF EXISTS `order`;
CREATE TABLE `order`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单信息Id',
  `userId` int(4) NULL DEFAULT NULL COMMENT '用户Id',
  `userName` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户名',
  `vehId` int(4) NULL DEFAULT NULL COMMENT '车辆Id',
  `ordersn` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单流水:第三方系统对接使用',
  `payType` tinyint(4) NULL DEFAULT NULL COMMENT '支付方式:0:微信,1:支付宝,2财富通',
  `paySn` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '支付的订单流水号',
  `vehName` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '车牌号',
  `parkingName` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '停车场名字',
  `price` double(20, 5) NULL DEFAULT NULL COMMENT '单价',
  `time` double(20, 5) NULL DEFAULT NULL COMMENT '时长',
  `charge` double(20, 5) NULL DEFAULT NULL COMMENT '收取费用:单价*时长',
  `content` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '评论内容',
  `intTime` datetime(0) NULL DEFAULT NULL COMMENT '入库时间',
  `outTime` datetime(0) NULL DEFAULT NULL COMMENT '出库时间',
  `status` tinyint(4) NULL DEFAULT NULL COMMENT '状态:0:下单,1:已入库,2:已出库,3:已支付,4:完成;5:取消',
  `createTime` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `updateTime` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `payTime` datetime(0) NULL DEFAULT NULL COMMENT '支付时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单明细表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for order_history
-- ----------------------------
DROP TABLE IF EXISTS `order_history`;
CREATE TABLE `order_history`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Id',
  `orderId` int(11) NULL DEFAULT NULL COMMENT '订单id',
  `thirdsn` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '第三方流水',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '描述',
  `status` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '取订单的状态值',
  `createTime` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `updateTime` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单历史表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for parking
-- ----------------------------
DROP TABLE IF EXISTS `parking`;
CREATE TABLE `parking`  (
  `id` int(4) NOT NULL AUTO_INCREMENT COMMENT '停车场编号',
  `createId` int(11) NULL DEFAULT NULL COMMENT '创建人Id',
  `regionId` int(11) NULL DEFAULT NULL COMMENT '地区id',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '停车场名字',
  `local` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '停车场位置',
  `status` tinyint(4) NULL DEFAULT NULL COMMENT '状态:0:没有空位置,1:有空位置',
  `status1` tinyint(4) NULL DEFAULT NULL COMMENT '状态0:不可以使用,1可以使用',
  `hourPrice` double(11, 2) NOT NULL COMMENT '停车每小时价格',
  `dayPrice` double(11, 2) NOT NULL COMMENT '停车每天价格',
  `image` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '停车场图片',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '描述',
  `sumCarport` int(11) NOT NULL COMMENT '车位总数',
  `useCarport` int(11) NOT NULL COMMENT '使用的车位',
  `leftCarport` int(11) NULL DEFAULT NULL COMMENT '剩余车位',
  `createTime` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `updateTime` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '停车场信息表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of parking
