-- ----------------------------
-- Table structure for region
-- ----------------------------
DROP TABLE IF EXISTS `region`;
CREATE TABLE `region`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键;自动递增',
  `parentId` int(11) NOT NULL COMMENT '上一级Id',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '名称',
  `pinyin` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '拼音',
  `areacode` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '地区编码',
  `brief` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '简称',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '内容',
  `leafStatus` tinyint(4) NOT NULL COMMENT '叶子节点状态:0:非叶子;1:叶子',
  `status` tinyint(4) NOT NULL COMMENT '状态:0:禁用,1:启用',
  `createTime` datetime(0) NOT NULL COMMENT '创建时间',
  `updateTime` datetime(0) NOT NULL COMMENT '更新时间',
  `pubTime` datetime(0) NOT NULL COMMENT '发布时间:用来排序',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3515 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '全国行政区划表' ROW_FORMAT = Compact;

