-- ----------------------------
-- Table structure for vehicle
-- ----------------------------
DROP TABLE IF EXISTS `vehicle`;
CREATE TABLE `vehicle`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '车牌Id',
  `userId` int(4) NOT NULL COMMENT '用户Id',
  `regionId` int(11) NULL DEFAULT NULL COMMENT '地区Id',
  `username` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户姓名',
